column8:
　M.D.I.専用イグニッションコイルキット
No.9535-00　<br><br>

旧車の円筒ＩＧコイルが、製造終了などにより入手が困難になりつつあり又、純正品が老朽化した場合等、他のＩＧコイルを選ぶ必要があります。現在市販されているＩＧコイルには特性が不明な場合や、ＭＤＩとのマッチングが懸念され、適合出来ないＩＧコイルもあり選択に苦慮することがあります。
 特に、スカイラインＧＴ－Ｒ(ＧＣ１０)やＺ４３２等に使用されたハイレシオＩＧコイルを換装するためのＩＧコイルとして開発されました。
 Ｎｏ．９５３５　ＩＧコイルはＭＤＩにマッチした特性で、円筒ＩＧコイルから配線を切断することなく移設出来ることに配慮した　ＭＤＩ 専用のオプションＩＧコイルキットです。<BR><BR>

※この専用IGコイルのご使用に当たっては、センターコードの挿入部の深さが一段と深くなっていますので、センターコードは永井電子シリコンコードを必ずご使用ください。純正のプラグコードでは挿入が十分でなく、IGコイルを破損してしまう可能性がありますのでご注意下さい。<style type="text/css">

